  def zzUnpackTrans(packed: String, offset: Int, result: Array[Int]): Int = {
    var i = 0       /* index in packed string  */
    var j = offset  /* index in unpacked array */
    val l = packed.length()
    while (i < l) {
      var count = packed.charAt(i).toInt; i += 1
      var value = packed.charAt(i).toInt; i += 1
      value -= 1
      result(j) = value; j+=1
      count -= 1
      while (count > 0){
        result(j) = value; j+=1
        count -= 1
      }
    }
    j
  }
