          case 73 => null // noop
          case 13 => 
             printDebug("CURRENCY")
               if(normalizeCurrency){
                 yytext() match{
                   case "\u00A2" => tok(NORMALIZED_CENTS)
                   case _ => tok(NORMALIZED_DOLLAR)
                 }
               }
               else tok()
          case 74 => null // noop
          case 14 => 
             printDebug("FRACTION")
               if(normalizeFractions){
                 yytext() match{
                   case "\u00BC" => tok(NORMALIZED_ONE_QUARTER)
                   case "\u00BD" => tok(NORMALIZED_ONE_HALF)
                   case "\u00BE" => tok(NORMALIZED_THREE_QUARTERS)
                   case "\u2153" => tok(NORMALIZED_ONE_THIRD)
                   case "\u2154" => tok(NORMALIZED_TWO_THIRDS)
                   case _ => tok()
                 }
               }
               else tok()
          case 75 => null // noop
          case 15 => 
             printDebug("MDASH"); if(normalizeMDash) tok(NORMALIZED_MDASH) else tok()
          case 76 => null // noop
          case 16 => 
             printDebug("GARB"); null
          case 77 => null // noop
          case 17 => 
             printDebug("APWORD"); tok()
          case 78 => null // noop
          case 18 => 
             printDebug("ESCAPED_SLASH"); if(unescapeSlash) tok(UNESCAPED_SLASH) else tok()
          case 79 => null // noop
          case 19 => 
             printDebug("ESCAPED_ASTERISK"); if(unescapeAsterisk) tok(UNESCAPED_ASTERISK) else tok()
          case 80 => null // noop
          case 20 => 
            // general lookahead, find correct zzMarkedPos
            { var zzFState = 1
              var zzFPos = zzStartRead
              if (zzFin.length <= zzBufferL.length) { zzFin = new Array[Boolean](zzBufferL.length+1) }
              val zzFinL = zzFin
              while (zzFState != -1 && zzFPos < zzMarkedPos) {
                zzFinL(zzFPos) = ((zzAttrL(zzFState) & 1) == 1)
                zzInput = Character.codePointAt(zzBufferL, zzFPos, zzMarkedPos)
                zzFPos += Character.charCount(zzInput)
                zzFState = zzTransL( zzRowMapL(zzFState) + zzCMapL(zzInput) )
              }
              if (zzFState != -1) { zzFinL(zzFPos) = ((zzAttrL(zzFState) & 1) == 1) } 
              zzFPos += 1
              while (zzFPos <= zzMarkedPos) {
                zzFinL(zzFPos) = false
                zzFPos += 1
              }

              zzFState = 2
              zzFPos = zzMarkedPos
              while (!zzFinL(zzFPos) || (zzAttrL(zzFState) & 1) != 1) {
                zzInput = Character.codePointBefore(zzBufferL, zzFPos, zzStartRead)
                zzFPos -= Character.charCount(zzInput)
                zzFState = zzTransL( zzRowMapL(zzFState) + zzCMapL(zzInput) )
              }
              zzMarkedPos = zzFPos
            }
             printDebug("EMOTICON"); tok()
          case 81 => null // noop
          case 21 => 
            // lookahead expression with fixed base length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzStartRead, 2)
             printDebug("SINGLE_INITIAL"); tok()
          case 82 => null // noop
          case 22 => 
             printDebug("ABBREVS"); tok()
          case 83 => null // noop
          case 23 => 
            // general lookahead, find correct zzMarkedPos
            { var zzFState = 3
              var zzFPos = zzStartRead
              if (zzFin.length <= zzBufferL.length) { zzFin = new Array[Boolean](zzBufferL.length+1) }
              val zzFinL = zzFin
              while (zzFState != -1 && zzFPos < zzMarkedPos) {
                zzFinL(zzFPos) = ((zzAttrL(zzFState) & 1) == 1)
                zzInput = Character.codePointAt(zzBufferL, zzFPos, zzMarkedPos)
                zzFPos += Character.charCount(zzInput)
                zzFState = zzTransL( zzRowMapL(zzFState) + zzCMapL(zzInput) )
              }
              if (zzFState != -1) { zzFinL(zzFPos) = ((zzAttrL(zzFState) & 1) == 1) } 
              zzFPos += 1
              while (zzFPos <= zzMarkedPos) {
                zzFinL(zzFPos) = false
                zzFPos += 1
              }

              zzFState = 4
              zzFPos = zzMarkedPos
              while (!zzFinL(zzFPos) || (zzAttrL(zzFState) & 1) != 1) {
                zzInput = Character.codePointBefore(zzBufferL, zzFPos, zzStartRead)
                zzFPos -= Character.charCount(zzInput)
                zzFState = zzTransL( zzRowMapL(zzFState) + zzCMapL(zzInput) )
              }
              zzMarkedPos = zzFPos
            }
             printDebug("CONTRACTED_WORD"); tok()
          case 84 => null // noop
          case 24 => 
             printDebug("EMAIL"); tok()
          case 85 => null // noop
          case 25 => 
             printDebug("DASHED_PREFIX_WORD")
               if(tokenizeAllDashedWords){
                 val word = yytext()
                 yypushback(yylength() - word.indexOf("-"))
               }
               tok()
          case 86 => null // noop
          case 26 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("CURRENCY"); if(normalizeCurrency) tok(NORMALIZED_DOLLAR) else tok()
          case 87 => null // noop
          case 27 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("CONSONANT_NON_ABBREVS"); tok()
          case 88 => null // noop
          case 28 => 
             printDebug("HASHTAG"); tok()
          case 89 => null // noop
          case 29 => 
             printDebug("ORDINALS"); tok()
          case 90 => null // noop
          case 30 => 
             printDebug("DECADE"); tok()
          case 91 => null // noop
          case 31 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("ELLIPSIS"); if(normalizeEllipsis) tok(NORMALIZED_ELLIPSIS) else tok()
          case 92 => null // noop
          case 32 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("CONTRACTION"); tok()
          case 93 => null // noop
          case 33 => 
             printDebug("NUMBER2"); tok()
          case 94 => null // noop
          case 34 => 
             printDebug("ATUSER"); tok()
          case 95 => null // noop
          case 35 => 
             printDebug("URL2"); tok()
          case 96 => null // noop
          case 36 => 
