          case 97 => null // noop
          case 37 => 
             printDebug("SGML"); if(tokenizeSgml) tok() else null
          case 98 => null // noop
          case 38 => 
             printDebug("HTML_SYMBOL")
               if(normalizeHtmlSymbol){
