          case 104 => null // noop
          case 44 => 
             printDebug("ESCAPED_ASTERISK2"); if(unescapeAsterisk) tok(UNESCAPED_ASTERISK2) else tok()
          case 105 => null // noop
          case 45 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("CAPS"); tok()
          case 106 => null // noop
          case 46 => 
             printDebug("HTMLCHAR"); tok()
          case 107 => null // noop
          case 47 => 
             printDebug("AMPERSAND"); if(normalizeAmpersand || normalizeHtmlSymbol) tok(NORMALIZED_AMPERSAND) else tok()
          case 108 => null // noop
          case 48 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("DASHED_PREFIX_WORD")
               if(tokenizeAllDashedWords){
