          case 115 => null // noop
          case 55 => 
            // lookahead expression with fixed base length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzStartRead, 3)
             printDebug("wanna"); tok()
          case 116 => null // noop
